css:
@-moz-document domain(tumblr.com) {
  #popover_blogs .tab_notice:after {display:none}
/*  DIV#xkit-control.xkit-help-forwarder > A,*/
  .tab_bar .iconic A.tab_anchor {
    background-image: /*url('https://40.media.tumblr.com/da322b5b88cfe72d11616434182e20aa/tumblr_nj0as9Hhhq1t4oa2fo1_250.png')*/
      url('https://40.media.tumblr.com/da322b5b88cfe72d11616434182e20aa/tumblr_nj0as9Hhhq1t4oa2fo1_250.png') !important;
    background-size: 175px 36px;
  }
/*
  .tab.iconic:not(.tab_log_out) .tab_anchor::before { content: none }

  .tab.iconic:nth-child(1) .tab_anchor { background-position: 0px 0; }
  .tab.iconic:nth-child(2) .tab_anchor { background-position: -35px 0; }
  .tab.iconic:nth-child(3) .tab_anchor { background-position: -70px 0; }
  .tab.iconic:nth-child(4) .tab_anchor { background-position: -105px 0; }
  .tab.iconic:nth-child(5) .tab_anchor { background-position: -140px 0; }
*/
  #account_button .icon_user_settings::before,
  DIV.tab_bar > .tab.iconic > .tab_anchor::before { content: none }

  #account_button .icon_arrow_carrot_down {position: relative; right: -24px; }
  #account_button {margin-right: 12px}

  #home_button .tab_anchor { background-position: 0px 0; }
  #inbox_button .tab_anchor { background-position: -35px 0; }
  #discover_button .tab_anchor { background-position: -70px 0; }
  #account_button .tab_anchor { background-position: -105px 0; } /* ex #preferences_button */
  #xkit-control.xkit-help-forwarder > .tab_anchor,
  #logout_button .tab_anchor { background-position: -140px 0; } /* ex #logout_button */
}
